  `colaborador_id` int NOT NULL,
  `fecha_registro` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `completada` tinyint(1) NOT NULL,
  `progreso` decimal(10,0) NOT NULL,
  `fecha_completada` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `capacitacion_id` (`capacitacion_id`),
  KEY `colaborador_id` (`colaborador_id`),
  CONSTRAINT `capacitaciones_colaboradores_ibfk_1` FOREIGN KEY (`capacitacion_id`) REFERENCES `capacitaciones` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `capacitaciones_colaboradores_ibfk_2` FOREIGN KEY (`colaborador_id`) REFERENCES `colaboradores` (`idColaborador`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=235 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
